    false,nt"url": null,nt"notes": "For Oneida County, NY, there were two types
    of elevation datasets. The first type is LiDAR and the second one is Auto-correlation
    DEM. Auto-correlation DEM data was developed wherever LiDAR data was not available.
    LiDAR data was made available to this project through two different initiatives.
    The first set of LiDAR data was made available through HMTAP-1650 project, which
    consisted of area of 3 miles buffers around Mohawk River. Though data was available
    for the whole length of Mohawk, only data that pertained to the county was used
    for this project.The second set of LiDAR data was made available for DFIRM. DFIRM
    data was delivered at two different times. The first delivery done in 2008 (covers
    middle part of the county) and the second delivery done in 2009 (covers a small
    area in the west, around Oneida lake). As the two coverages did not have issues
    dealing with overlaps, they were used as they are. For the auto correlated data,
    in an effort to provide an alternative to the collection of LiDAR data and utilization
    of the National Elevation Dataset (NED), Dewberry has tested the methodology for
    the generation of a photogrammetrically derived surface model appropriate for Hydrologic
    and Hydraulic modeling and conforming to FEMA standards.The autocorrelated surface
    was generated using imagery from the 2003 New York statewide collection along with
    the Aerial Triangulation (AT) solution provided with the source imagery. The surface
    was subsequently edited through manual processes and improved with breaklines in
    order to meet ASPRS Class 1 accuracy requirements for 4 foot contour mapping.The
    final terrain is named as Oneida_Terrain.gdb. Please check the image from the PDF
    report in the General folder of the MIP submitted data.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
